VALUES ('3700105248525', 'Patis decor', 'sucre, sirop de glucose, huile végétale (palmiste, palme), humectant E422, épaississants E413-E415, émulsifiant E471, arôme naturel, invertase. Peut contenir des traces d\'amande. Conserver à l\'abri de la chaleur et de l\'humidité. NO de lot et DILUO : voir emballage. EN : With this ready roued white icing, you witt be able to cover your cake very quickly and without any troubles ! You will recognize the sweet and vanitta flavored taste of Patisdecor sugarpaste. Ingredients : sugar, glucose syrup, vegetable fat (palm kernel, palm), humectant E422, thickeners E413-E415, emulsifier E471, natural flavouring invertase. This product may contain traces of almonds. Store in a cool, dry place away from light. Questa spread pasta di zucchero bianca e pronto per t\'uso, è in grado di coprire rapidamente e facilmente le vostre torte. Trova il buon gusto di vanigüa deuta pasta di zucchero Patisdécor ! Ingredients : zucchero. sciroppo di glucosio, olio vegetale (di palmisti, palma), umettante E422, addensanti E413-E415, emulsionante E471, aromi naturali, invertasi. Puo contenere tracce di mandorla. Conservare al riparo da umidità e fonti di calore.', 'https://static.openfoodfacts.org/images/products/370/010/524/8525/front_fr.4.400.jpg', '5.3', '3.7', '87.5', '85.2', '0.2', '0', '0.03', '0.0118110236220472', '', '0');

